Publikacja przedstawia tematykę zatrudnienia na podstawie stosunku służbowego, w jakim pozostają funkcjonariusze służb mundurowych (zmilitaryzowanych) oraz żołnierze zawodowi.

Omówiono w niej m.in. następujące zagadnienia:
- nawiązanie, przekształcenie oraz ustanie stosunku służbowego;
- uprawnienia funkcjonariuszy i żołnierzy zawodowych, takie jak: uposażenie i inne świadczenia pieniężne z tytułu pełnienia służby, rodzaje urlopów, a także uprawnienia socjalne, rodzicielskie, w zakresie równego traktowania w zatrudnieniu oraz występowania mobbingu;
- obowiązki funkcjonariuszy i żołnierzy zawodowych, w tym dotyczące czasu służby czy poddania się ocenie okresowej;
- odpowiedzialność majątkowa oraz dyscyplinarna funkcjonariuszy.

Oprócz wymienionych tematów z obszaru indywidualnych spraw funkcjonariuszy i żołnierzy zawodowych w opracowaniu przedstawiono również zbiorowe prawo zatrudnienia administracyjnoprawnego oraz niezwykle istotny z punktu widzenia realizacji uprawnień i obowiązków funkcjonariuszy i żołnierzy zawodowych problem rozstrzygania sporów. Nie zostały pominięte ważne kwestie ogólnoteoretyczne, np. charakter prawny stosunku służbowego oraz funkcje zatrudnienia administracyjnoprawnego.

Książka jest przeznaczona dla funkcjonariuszy i pracowników działów kadr służb mundurowych, związkowców w nich działających, a także studentów wydziałów prawa i administracji oraz kierunków związanych z bezpieczeństwem narodowym.

The publication presents the subject of employment on the basis of the service relationship in which officers of the uniformed services (militarized) and professional soldiers remain.

It discusses, among other things, the following issues:
- establishment, transformation and termination of the official relationship;
- the rights of officers and professional soldiers, such as: emoluments and other monetary benefits for service, types of leave, as well as social rights, parental rights, in terms of equal treatment in employment and the occurrence of mobbing;
- duties of officers and professional soldiers, including those relating to time of service or submission to periodic evaluation;
- property and disciplinary liability of officers.

In addition to the above-mentioned topics in the area of individual matters of officers and professional soldiers, the study also presents the collective law of administrative-legal employment and the problem of dispute resolution, which is extremely important from the point of view of the implementation of the rights and duties of officers and professional soldiers. Important general theoretical issues, such as the legal nature of the service relationship and the functions of administrative-legal employment, have not been overlooked.

The book is intended for officers and employees of human resources departments of the uniformed services, trade unionists in them, as well as students of law and administration faculties and majors related to national security.
